function Card(props) {
  console.log("Data :", props.data);
  return (
    <div className="card">
      {props.data.map((elm, id) => (
        <div key={id} className="card-container">
            <div className="details-container"></div>
            <div className="author-container"></div>

            <div className="card-author"><b>~{elm.author}</b></div>
        </div>
      ))}
    </div>
  );
}

export default Card;
